import { Container, Modal,Button } from "react-bootstrap";

function Modal1(props) {

    const delData = () =>{
        props.deletech(props.datadel);
        props.setDataToDelClose()
        props.setdataToDel(null);
    }

  const handleModalContainerClick = (e) => e.stopPropagation();
  return (
    <Modal {...props}>
      <Modal.Header>
        <Modal.Title
          className="d-flex justify-content-between mb "
          id="contained-modal-title-vcenter"
        >
          <div>Elminar Chofer</div>
          <Button
            style={{ marginLeft: "250px" , borderRadius:"50%" }}
            className="btn-fill align-items-end "
            variant="danger"
            onClick={props.setDataToDelClose}
          >
              X
          </Button>
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Container>{props.children}</Container>
      </Modal.Body>
      <Modal.Footer>
        <Button
          style={{ marginLeft: "auto" }}
          className="btn-fill "
          variant="danger"
          onClick={props.setDataToDelClose}
        >
          Cancelar
        </Button>
        <Button
          style={{ marginLeft: "6px" }}
          className="btn-fill "
          variant="info"
          onClick={() => delData()}
        >
          Aceptar
        </Button>
      </Modal.Footer>
    </Modal>
  );
}
export default Modal1;
